  async componentWillMount() {
    await this.loadData()
  }

  async loadData() {
    console.log(await storage.methods.retrieve().call());
  }


  constructor(props){
    super(props)
    this.state = {
      contract:'',
    }    
  }

  render() {
    return (
      <div className="Home">
        <Nbar/>
      </div>
    );
  }
}

export default App;
